description:
Den ultimata overlevaren tillsammans med sex deltagare ledda av Nina Papas.De ska tillsammans overleva i ett post-apokalyptiskt wasteland . Men for deltagarna visar det sig att det inte bara ar odelandet de maste overleva utan aven de som bor dar. Ganska snart stalls de infor infodda, inavlade och deformerade kannibaler som bara har en plan - att brutalt stycka dem och servera dem till middag...

